import { style } from "typestyle";

const HomeHowItWorkStyle = style({
    // backgroundColor: 'red',
    height: '80vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    $nest: {
        '& .title': {
            $nest: {
                '& span': {
                    fontFamily: 'GothamLight'
                },
            }
        },
        '& .circle': {
            position: 'relative',
            height: '150px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            width: '150px',
            borderRadius: '50%',
            // backgroundColor: 'red',
            border: 'solid blue 3px',
            $nest: { 
                '& .circle_color': {
                    height: '110%',
                    width: '110%',
                    borderRadius: '50%',
                    position: 'absolute',
                    left: -18,
                    top: -5,
                    backgroundColor: 'red',
                    zIndex: -1
                },
                '& .num': {
                    zIndex: 1
                }
            }
        }
    }
})

export default HomeHowItWorkStyle
